import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
    height: 126px;
    width: 380px;
    display: flex;
    align-items: center;
    padding: 0 10px;
    background-color: white;
    margin-bottom: 20px;
    border-radius: 6px;
    box-shadow: -1px 2px 25px 3px rgba(0, 0, 0, 0.11);
`;

export default Container;
